import React from 'react';
import Header from './Components/Header';
import Main from './Components/Main';
import { Helmet } from 'react-helmet';
function App() {
  return (
    <div className='App'>
      <Helmet>
        <meta name="viewport" content="width=device-width, initial-scale=1.0" />
      </Helmet>
      <Header />
      <Main />
    </div>
  );
}

export default App;
